import React from "react";
import { Header, Segment } from "semantic-ui-react";

const HeaderInverted = () => (
  <Segment inverted>
    <Header size='huge' inverted color='yellow' id="header">BMI Calculator</Header>
  </Segment>
)

export default HeaderInverted;
